import React from 'react';

class Testbtn extends React.Component{
  constructor(props){
    super(props);
    this.state={
    name: 'honda',
    pcard: ''
  }
  function hondatrue(){
    alert = 'できた'
  }
}
  render(){
    return(
      <div>
      <button className='honda' onClick={()=> {hondatrue}}></button>
      </div>
    );
  }
}

export default Testbtn;
